        let key=array[i];
        let j= i-1;
        animations.push(i,i);
        while(j>=0&& array[j]>key)
        {
            array[j+1]=array[j];
            animations.push(j,j+1);
            animations.push(j,j+1);
            animations.push(j,j+1);
            j--;
        }
        animations.push(j+1,i);
        array[j+1]=key;
    }
    console.log(array);
    return animations;
}
